import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

index:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,
    
},

index1:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    height:300,
    justifyContent:'center',
    // width: 300,
},

indexImg:{
    alignItems:'center',    
},


dados:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,
},

dadosText:{
    fontWeight:'bold',
    fontSize: 20,
},
    
})
